          body_header: "We give architecture a second life",
          body_text:
            "<p>To make our buildings sustainable, we employ the most efficient construction methods and moderate their use of materials and energy. We build circularity into our projects – allowing materials to enjoy a second life – and even design scenarios for their future. Buildings like Jakoba Mulderhuis in Amsterdam can easily change their function further down the line, so they won't become redundant. We think beyond a building's current life – how can it change with the times, and how can it be dismantled and reused when the time comes?</p>\n<p>Our in-house BREEAM and WELL specialists ensure that our buildings conform to the highest possible environmental and wellness standards. We also work with external experts and often take an experimental approach that we tailor to each project, taking account of its unique site and context.</p>\n",
