          body_header_2: "Sustainability is about good design",
          body_text_2:
            "<p>A timeless design ensures that a building will enjoy a long life, which is why we design buildings that people love and want to keep using. Timelessness means that buildings are enduringly beautiful and that they are adaptable through a certain pragmatic simplicity. We take advantage of the site and use natural elements like sunlight; we choose sustainable, local, and natural materials; and we implement circularity and reuse into our designs. We never forget that complicated technological solutions could become obsolete just a few years from now. By designing beautiful buildings that are deceptively simple, non-polluting, recyclable, and – above all – enjoyable, we can contribute to a solution to the climate crisis.</p>\n",
