          role: "Junior Architect, Hyderabad",
          bio: "<p>Bhavani is an Interior Design graduate from JNAFAU. Her interest in Community living and climate responsive architecture led to her internship at Sacred Groves, Auroville where she has experienced hands-on approach to natural building techniques and led a research team formulating the \"Green Cement\" for it's compressive strength. At Studio Inscape, she is practicing to compose architecture at an mm level. She's also an aspiring potteress, scoops clay from site visits and hoards rocks.</p>",
